import React, { useState } from 'react';

const workoutGoals = [
  { id: 'fat-loss', label: 'ðŸ”¥ Fat Loss' },
  { id: 'strength', label: 'ðŸ’ª Strength Building' },
  { id: 'endurance', label: 'ðŸƒâ€â™€ï¸ Endurance' },
  { id: 'toning', label: 'âœ¨ Toning' }
];

const intensityLevels = [
  { id: 'beginner', label: 'Beginner' },
  { id: 'intermediate', label: 'Intermediate' },
  { id: 'advanced', label: 'Advanced' }
];

export default function AIWorkoutGenerator() {
  const [selectedGoals, setSelectedGoals] = useState([]);
  const [intensity, setIntensity] = useState('intermediate');
  const [workout, setWorkout] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const handleGoalChange = (goalId) => {
    setSelectedGoals(prev => 
      prev.includes(goalId)
        ? prev.filter(id => id !== goalId)
        : [...prev, goalId]
    );
  };

  const generateWorkout = async () => {
    setLoading(true);
    setError(null);

    try {
      const response = await fetch('/api/generate-workout', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          goals: selectedGoals,
          intensity,
          profile: {
            goals: selectedGoals,
          },
        }),
      });

      if (!response.ok) {
        throw new Error('Failed to generate workout');
      }

      const data = await response.json();
      setWorkout(data.workout);
    } catch (err) {
      setError('Failed to generate workout. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="max-w-4xl mx-auto p-6">
      <div className="bg-white rounded-xl shadow-lg overflow-hidden">
        {/* Goals Selection */}
        <div className="p-6">
          <h2 className="text-xl font-bold mb-4">Select Your Goals</h2>
          <div className="grid grid-cols-1 md:grid-cols-2 gap-4 mb-6">
            {workoutGoals.map((goal) => (
              <label
                key={goal.id}
                className={`flex items-center p-4 rounded-lg border cursor-pointer transition-colors ${
                  selectedGoals.includes(goal.id)
                    ? 'bg-blue-50 border-blue-500'
                    : 'hover:bg-gray-50'
                }`}
              >
                <input
                  type="checkbox"
                  checked={selectedGoals.includes(goal.id)}
                  onChange={() => handleGoalChange(goal.id)}
                  className="h-5 w-5 text-blue-600 rounded"
                />
                <span className="ml-3 text-lg">{goal.label}</span>
              </label>
            ))}
          </div>

          <h2 className="text-xl font-bold mb-4">Select Intensity Level</h2>
          <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
            {intensityLevels.map((level) => (
              <label
                key={level.id}
                className={`flex items-center p-4 rounded-lg border cursor-pointer transition-colors ${
                  intensity === level.id
                    ? 'bg-blue-50 border-blue-500'
                    : 'hover:bg-gray-50'
                }`}
              >
                <input
                  type="radio"
                  name="intensity"
                  value={level.id}
                  checked={intensity === level.id}
                  onChange={(e) => setIntensity(e.target.value)}
                  className="h-5 w-5 text-blue-600"
                />
                <span className="ml-3">{level.label}</span>
              </label>
            ))}
          </div>
        </div>

        {/* Generate Button */}
        <div className="px-6 pb-6">
          <button
            onClick={generateWorkout}
            disabled={selectedGoals.length === 0 || loading}
            className={`w-full py-3 px-6 rounded-lg text-white font-semibold ${
              selectedGoals.length === 0 || loading
                ? 'bg-gray-400 cursor-not-allowed'
                : 'bg-blue-600 hover:bg-blue-700'
            }`}
          >
            {loading ? 'Generating Workout...' : 'Generate AI Workout Plan'}
          </button>
        </div>

        {/* Error Message */}
        {error && (
          <div className="px-6 pb-6">
            <div className="bg-red-100 text-red-700 p-4 rounded-lg">
              {error}
            </div>
          </div>
        )}

        {/* Workout Plan */}
        {workout && (
          <div className="border-t border-gray-200">
            <div className="p-6">
              <h2 className="text-xl font-bold mb-6">Your Personalized Workout Plan</h2>
              <div className="space-y-6">
                {workout.map((exercise, index) => (
                  <div key={index} className="bg-gray-50 rounded-lg p-6">
                    <h3 className="text-lg font-semibold mb-2">{exercise.name}</h3>
                    <div className="text-gray-600">
                      {exercise.sets} sets Ã— {exercise.reps} reps
                      {exercise.notes && (
                        <p className="mt-2 text-sm">{exercise.notes}</p>
                      )}
                    </div>
                  </div>
                ))}
              </div>
            </div>
          </div>
        )}
      </div>
    </div>
  );
}
